import React from 'react';
import logo from './logo.svg';
import './App.css';
import {Routes, Route, NavLink} from "react-router-dom";
import { Home } from './Pages/Home';

function App() {
  return (
    <div>
      <nav>
        <NavLink to="">Accueil</NavLink>
      </nav>
      <Routes>
        <Route path='' element={<Home/>}/>
      </Routes>
    </div>
  );
}

export default App;
